import styled from "@emotion/styled/types/base";
import ProductItem from "./ProductItem";
import { products } from "../pages/data";

const Container = styled.div``;

const Products = () => {
  return (
    <Container>
      {products.map((item) => (
        <ProductItem item={item} />
      ))}
    </Container>
  );
};

export default Products;
